import React from 'react'
// import './NestedMapping.css'
import Users from './User.json';
import UserList from './UserList';

function NestedMapping() {
  return (
    <div className='container'>
         
         {Users.map((user)=>(
          <UserList />
         ))}
     
    </div>
  )
}

export default NestedMapping
